window.bookSummaryJSON = "<p>Simon has spent the last six months hunting Incarnations and has begun to realize that his power alone won’t be enough to stop a true enemy.</p> <p>Leah is queen over a nation of refugees, driven from their homes by the fury of Territories gone mad.</p> <p>Alin rules his city with an iron fist, imposing the virtues of Elysia on an imperfect population.</p> <p>Now, the three must stand united as the balance of the world shifts once more. A greater threat looms, and it has made its presence known....</p> <p>The Incarnations are missing.</p>"; 
